import React, { Component } from 'react';
class Inputitem extends Component {
    onDeleteChild(){
        this.props.onClick(this.props.index);
    }
  render() {
    return (
      <div onClick={this.onDeleteChild.bind(this)}>
       {this.props.content}        
      </div>
    );
  }
}

export default Inputitem;
